import AppRoutes from "./routes/AppRoutes";
import { BrowserRouter } from "react-router-dom";
import SnackBar from "./components/sanackbar/SnackBar";

const ThemeProvider = {};

const App = () => {
  return (
    <BrowserRouter>
      <AppRoutes />
      <SnackBar />
    </BrowserRouter>
  );
};

export default App;
